import NavBar from "./componentes/Navbar";

function App() {
    return (
        <BrowserRouter>
            <NavBar />
                <Switch>
                    <Route path="/">

                    </Route>

                    <Route path="Sobre">
                        
                    </Route>
                </Switch>
        </BrowserRouter>

    );
};

export default App
